( 
[CITY_CODE],  
[COUNTY_CODE],  
[STATE_CODE],  
[STATE_TEXT],  
[COUNTY_TEXT],  
[CITY_TEXT],  
[USER_LOGIN],  
[UPDATE_DATE] 
) 
VALUES 
( 
